const appEl = document.getElementById("app");
const modalRoot = document.getElementById("modal-root");

const state = {
  view: "home",
  activeSession: null,
  thankYouTimer: null,
  completedRecord: null,
  db: null, // IndexedDB 数据库实例
  dbReady: false, // 数据库是否已初始化
};

let surveys = [];
let responses = [];

// IndexedDB 初始化
function initDB() {
  return new Promise((resolve, reject) => {
    if (state.db && state.dbReady) {
      resolve(state.db);
      return;
    }

    const request = indexedDB.open(DB_NAME, DB_VERSION);

    request.onerror = () => {
      console.error("IndexedDB 打开失败", request.error);
      reject(request.error);
    };

    request.onsuccess = () => {
      state.db = request.result;
      state.dbReady = true;
      resolve(state.db);
    };

    request.onupgradeneeded = (event) => {
      const db = event.target.result;
      
      // 创建问卷存储对象
      if (!db.objectStoreNames.contains(STORAGE_KEYS.SURVEYS)) {
        db.createObjectStore(STORAGE_KEYS.SURVEYS, { keyPath: "id" });
      }
      
      // 创建答卷存储对象
      if (!db.objectStoreNames.contains(STORAGE_KEYS.RESPONSES)) {
        db.createObjectStore(STORAGE_KEYS.RESPONSES, { keyPath: "id" });
      }
    };
  });
}

// 从 IndexedDB 加载问卷
async function loadSurveys() {
  try {
    await initDB();
    return new Promise((resolve, reject) => {
      const transaction = state.db.transaction([STORAGE_KEYS.SURVEYS], "readonly");
      const store = transaction.objectStore(STORAGE_KEYS.SURVEYS);
      const request = store.getAll();

      request.onsuccess = () => {
        const loaded = request.result || [];
        // 如果有数据则返回，否则使用默认问卷
        if (loaded.length > 0) {
          resolve(loaded);
        } else if (DEFAULT_SURVEYS && DEFAULT_SURVEYS.length > 0) {
          // 首次加载时，使用默认问卷
          const defaultCopy = JSON.parse(JSON.stringify(DEFAULT_SURVEYS));
          // 标记需要保存默认问卷到数据库
          resolve(defaultCopy);
        } else {
          resolve([]);
        }
      };

      request.onerror = () => {
        console.error("加载问卷失败", request.error);
        // 失败时尝试使用默认问卷
        if (DEFAULT_SURVEYS && DEFAULT_SURVEYS.length > 0) {
          resolve(JSON.parse(JSON.stringify(DEFAULT_SURVEYS)));
        } else {
          resolve([]);
        }
      };
    });
  } catch (e) {
    console.error("初始化数据库失败", e);
    // 降级到 localStorage
    try {
      const raw = localStorage.getItem(STORAGE_KEYS.SURVEYS);
      const stored = raw ? JSON.parse(raw) : [];
      if (stored.length > 0) {
        return stored;
      } else if (DEFAULT_SURVEYS && DEFAULT_SURVEYS.length > 0) {
        return JSON.parse(JSON.stringify(DEFAULT_SURVEYS));
      }
      return [];
    } catch {
      // 最后尝试使用默认问卷
      if (DEFAULT_SURVEYS && DEFAULT_SURVEYS.length > 0) {
        return JSON.parse(JSON.stringify(DEFAULT_SURVEYS));
      }
      return [];
    }
  }
}

// 从 IndexedDB 加载答卷
async function loadResponses() {
  try {
    await initDB();
    return new Promise((resolve, reject) => {
      const transaction = state.db.transaction([STORAGE_KEYS.RESPONSES], "readonly");
      const store = transaction.objectStore(STORAGE_KEYS.RESPONSES);
      const request = store.getAll();

      request.onsuccess = () => {
        resolve(request.result || []);
      };

      request.onerror = () => {
        console.error("加载答卷失败", request.error);
        resolve([]); // 失败时返回空数组
      };
    });
  } catch (e) {
    console.error("初始化数据库失败", e);
    // 降级到 localStorage
    try {
      const raw = localStorage.getItem(STORAGE_KEYS.RESPONSES);
      return raw ? JSON.parse(raw) : [];
    } catch {
      return [];
    }
  }
}

// 防抖函数
function debounce(func, wait) {
  let timeout;
  return function executedFunction(...args) {
    const later = () => {
      clearTimeout(timeout);
      func(...args);
    };
    clearTimeout(timeout);
    timeout = setTimeout(later, wait);
  };
}

// 延迟保存的防抖函数
let persistSurveysDebounced = null;
let persistResponsesDebounced = null;

// 保存问卷到 IndexedDB
async function persistSurveys() {
  try {
    await initDB();
    const transaction = state.db.transaction([STORAGE_KEYS.SURVEYS], "readwrite");
    const store = transaction.objectStore(STORAGE_KEYS.SURVEYS);
    
    // 先获取现有数据，用于对比
    const existing = await new Promise((resolve, reject) => {
      const request = store.getAll();
      request.onsuccess = () => resolve(request.result || []);
      request.onerror = () => reject(request.error);
    });
    
    const existingIds = new Set(existing.map(s => s.id));
    const newIds = new Set(surveys.map(s => s.id));
    
    // 删除已移除的问卷
    const toDelete = existing.filter(s => !newIds.has(s.id));
    for (const survey of toDelete) {
      await new Promise((resolve, reject) => {
        const request = store.delete(survey.id);
        request.onsuccess = () => resolve();
        request.onerror = () => reject(request.error);
      });
    }
    
    // 保存或更新所有问卷（使用 put 支持更新）
    const promises = surveys.map((survey) => {
      return new Promise((resolve, reject) => {
        const request = store.put(survey);
        request.onsuccess = () => resolve();
        request.onerror = () => reject(request.error);
      });
    });
    
    await Promise.all(promises);
    
    // 同时备份到 localStorage（作为备用）
    try {
      localStorage.setItem(STORAGE_KEYS.SURVEYS, JSON.stringify(surveys));
    } catch (e) {
      // localStorage 失败不影响主流程
      console.warn("localStorage 备份失败", e);
    }
  } catch (e) {
    console.error("保存问卷数据失败", e);
    // 降级到 localStorage
    try {
      localStorage.setItem(STORAGE_KEYS.SURVEYS, JSON.stringify(surveys));
    } catch (localError) {
      alert("存储空间不足，请清理浏览器缓存或删除部分问卷。");
    }
  }
}

// 保存答卷到 IndexedDB
async function persistResponses() {
  try {
    await initDB();
    const transaction = state.db.transaction([STORAGE_KEYS.RESPONSES], "readwrite");
    const store = transaction.objectStore(STORAGE_KEYS.RESPONSES);
    
    // 先获取现有数据，用于对比
    const existing = await new Promise((resolve, reject) => {
      const request = store.getAll();
      request.onsuccess = () => resolve(request.result || []);
      request.onerror = () => reject(request.error);
    });
    
    const existingIds = new Set(existing.map(r => r.id));
    const newIds = new Set(responses.map(r => r.id));
    
    // 删除已移除的答卷
    const toDelete = existing.filter(r => !newIds.has(r.id));
    for (const response of toDelete) {
      await new Promise((resolve, reject) => {
        const request = store.delete(response.id);
        request.onsuccess = () => resolve();
        request.onerror = () => reject(request.error);
      });
    }
    
    // 保存或更新所有答卷（使用 put 支持更新）
    const promises = responses.map((response) => {
      return new Promise((resolve, reject) => {
        const request = store.put(response);
        request.onsuccess = () => resolve();
        request.onerror = () => reject(request.error);
      });
    });
    
    await Promise.all(promises);
    
    // 同时备份到 localStorage（作为备用）
    try {
      localStorage.setItem(STORAGE_KEYS.RESPONSES, JSON.stringify(responses));
    } catch (e) {
      // localStorage 失败不影响主流程
      console.warn("localStorage 备份失败", e);
    }
  } catch (e) {
    console.error("保存答卷数据失败", e);
    // 降级到 localStorage
    try {
      localStorage.setItem(STORAGE_KEYS.RESPONSES, JSON.stringify(responses));
    } catch (localError) {
      alert("存储空间不足，请清理浏览器缓存或删除部分答卷。");
    }
  }
}

// 初始化防抖保存函数
function initDebouncedPersist() {
  if (!persistSurveysDebounced) {
    persistSurveysDebounced = debounce(persistSurveys, 300);
  }
  if (!persistResponsesDebounced) {
    persistResponsesDebounced = debounce(persistResponses, 300);
  }
}

// 立即保存（用于关键操作）
function persistSurveysImmediate() {
  persistSurveys();
}

function persistResponsesImmediate() {
  persistResponses();
}

async function refreshData() {
  surveys = await loadSurveys();
  responses = await loadResponses();
  render();
}

function safeTrim(value) {
  return typeof value === "string" ? value.trim() : "";
}

function createId(prefix = "id") {
  const random = Math.random().toString(36).slice(2, 8);
  return `${prefix}_${Date.now().toString(36)}_${random}`;
}

function setView(view) {
  state.view = view;
  render();
}

function render() {
  switch (state.view) {
    case "home":
      renderHome();
      break;
    case "demographics":
      renderDemographicForm();
      break;
    case "reminderNotice":
      renderReminderNotice();
      break;
    case "question":
      renderQuestionView();
      break;
    case "thankyou":
      renderThankYou();
      break;
    default:
      renderHome();
  }
}

