function handleDemographicSubmit(form) {
  const age = Number(form.age.value);
  const gender = form.gender.value;
  if (!age || !gender) {
    alert("请完整填写信息");
    return;
  }
  const available = surveys.filter((s) => s.questions && s.questions.length > 0);
  if (available.length === 0) {
    alert("暂无可用问卷，请稍后再试。");
    return;
  }
  const survey = available[Math.floor(Math.random() * available.length)];
  state.activeSession = {
    survey,
    questionIndex: 0,
    answers: [],
    age,
    gender,
    questionStart: null,
  };
  setView("question");
}

function handleLikertSelection(value) {
  const session = state.activeSession;
  if (!session) return;
  const elapsed = Math.round(performance.now() - (session.questionStart || 0));
  const question = session.survey.questions[session.questionIndex];
  session.answers.push({
    questionId: question.id,
    choice: Number(value),
    durationMs: elapsed > 0 ? elapsed : 0,
  });
  session.questionIndex += 1;
  if (session.questionIndex >= session.survey.questions.length) {
    completeSurveySession();
  } else {
    setView("question");
  }
}

function completeSurveySession() {
  const session = state.activeSession;
  if (!session) {
    setView("home");
    return;
  }
  const record = {
    id: createId("resp"),
    shortId: Math.random().toString(36).slice(2, 6).toUpperCase(),
    surveyId: session.survey.id,
    surveyTitle: session.survey.title,
    age: session.age,
    gender: session.gender,
    answers: session.answers,
    submittedAt: Date.now(),
  };
  responses.push(record);
  persistResponses();
  state.completedRecord = record;
  state.activeSession = null;
  setView("thankyou");
}


function attachGlobalEvents() {
  appEl.addEventListener("click", (event) => {
    const action = event.target.dataset.action;
    if (action) {
      handleAction(action, event.target);
      return;
    }
    const likert = event.target.dataset.likert;
    if (likert) {
      handleLikertSelection(likert);
    }
  });

  // 处理拖拽图片到题目编辑窗口（同时支持主页面和模态框）
  const handleDragEvent = (event) => {
    const dropzone = event.target.closest
      ? event.target.closest("[data-dropzone]")
      : null;
    if (!dropzone) return;
    event.preventDefault();
    event.stopPropagation();

    const eventName = event.type;
    if (eventName === "dragenter" || eventName === "dragover") {
      dropzone.classList.add("drag-over");
    } else if (eventName === "dragleave") {
      dropzone.classList.remove("drag-over");
    } else if (eventName === "drop") {
      dropzone.classList.remove("drag-over");
      const form = dropzone.closest("form");
      handleImageDrop(event, dropzone.dataset.dropzone, form);
    }
  };

  ["dragenter", "dragover", "dragleave", "drop"].forEach((eventName) => {
    // 绑定到主页面
    appEl.addEventListener(eventName, handleDragEvent, false);
    // 绑定到模态框容器
    modalRoot.addEventListener(eventName, handleDragEvent, false);
  });

  document.addEventListener("submit", (event) => {
    const form = event.target;
    if (form.id === "demographic-form") {
      event.preventDefault();
      handleDemographicSubmit(form);
    }
  });

  modalRoot.addEventListener("click", (event) => {
    if (event.target.dataset.action === "close-modal") {
      closeModal();
    } else if (event.target.dataset.action === "confirm-reminder") {
      closeModal();
      setView("reminderNotice");
    } else if (event.target.classList.contains("modal-overlay")) {
      closeModal();
    }
  });
}

function handleAction(action, target) {
  switch (action) {
    case "enter-questionnaire":
      showReminderModal();
      break;
    case "back-home":
      state.activeSession = null;
      state.completedRecord = null;
      setView("home");
      break;
    case "go-demographics":
      setView("demographics");
      break;
    case "import-surveys":
      importSurveysFromFile();
      break;
    default:
      break;
  }
}

function compressImage(file, maxWidth = 800, maxHeight = 800, quality = 0.8) {
  return new Promise((resolve, reject) => {
    const reader = new FileReader();
    reader.onload = (e) => {
      const img = new Image();
      img.onload = () => {
        const canvas = document.createElement("canvas");
        let width = img.width;
        let height = img.height;

        // 计算缩放比例
        if (width > maxWidth || height > maxHeight) {
          const ratio = Math.min(maxWidth / width, maxHeight / height);
          width = width * ratio;
          height = height * ratio;
        }

        canvas.width = width;
        canvas.height = height;

        const ctx = canvas.getContext("2d");
        ctx.drawImage(img, 0, 0, width, height);

        // 转换为 base64
        const compressedDataUrl = canvas.toDataURL("image/jpeg", quality);
        resolve(compressedDataUrl);
      };
      img.onerror = reject;
      img.src = e.target.result;
    };
    reader.onerror = reject;
    reader.readAsDataURL(file);
  });
}

function handleImageDrop(event, targetName, form) {
  const dt = event.dataTransfer;
  if (!dt || !dt.files || dt.files.length === 0) return;
  const file = dt.files[0];

  const type = (file.type || "").toLowerCase();
  const name = (file.name || "").toLowerCase();
  const isJpg =
    type === "image/jpeg" ||
    type === "image/jpg" ||
    name.endsWith(".jpg") ||
    name.endsWith(".jpeg");
  const isPng =
    type === "image/png" ||
    name.endsWith(".png");

  if (!isJpg && !isPng) {
    alert("目前仅支持拖入 JPG / JPEG / PNG 图片文件。");
    return;
  }

  // 检查文件大小（5MB 限制）
  const maxFileSize = 5 * 1024 * 1024; // 5MB
  if (file.size > maxFileSize) {
    alert(`图片文件过大（${(file.size / 1024 / 1024).toFixed(2)}MB），请选择小于 5MB 的图片。`);
    return;
  }

  // 显示加载提示
  const preview = form.querySelector(
    `.drop-preview[data-preview="${targetName}"]`
  );
  if (preview) {
    preview.innerHTML = `<span style="color: #6366f1;">正在处理图片...</span>`;
  }

  // 压缩图片
  compressImage(file, 800, 800, 0.8)
    .then((compressedDataUrl) => {
      if (!form) return;
      const input = form.elements[targetName];
      if (!input) return;
      input.value = compressedDataUrl;

      // 显示预览（使用缩略图）
      if (preview) {
        const previewImg = document.createElement("img");
        previewImg.src = compressedDataUrl;
        previewImg.style.maxWidth = "56px";
        previewImg.style.maxHeight = "56px";
        previewImg.style.objectFit = "cover";
        previewImg.style.borderRadius = "8px";
        preview.innerHTML = "";
        preview.appendChild(previewImg);
        const nameSpan = document.createElement("span");
        nameSpan.textContent = file.name;
        preview.appendChild(nameSpan);
      }
    })
    .catch((error) => {
      console.error("图片处理失败", error);
      alert("图片处理失败，请重试。");
      if (preview) {
        preview.innerHTML = "";
      }
    });
}

function exportAllSurveys() {
  if (!surveys || surveys.length === 0) {
    alert("当前没有可导出的问卷。");
    return;
  }
  const payload = {
    exportedAt: new Date().toISOString(),
    count: surveys.length,
    surveys,
  };
  const blob = new Blob([JSON.stringify(payload, null, 2)], {
    type: "application/json;charset=utf-8",
  });
  const filename = `问卷题库导出-${new Date()
    .toISOString()
    .slice(0, 19)
    .replace(/[:T]/g, "-")}.json`;
  const link = document.createElement("a");
  link.href = URL.createObjectURL(blob);
  link.download = filename;
  document.body.appendChild(link);
  link.click();
  document.body.removeChild(link);
}

function importSurveysFromFile() {
  const input = document.createElement("input");
  input.type = "file";
  input.accept = ".json,application/json";
  input.onchange = (event) => {
    const file = event.target.files && event.target.files[0];
    if (!file) return;
    const reader = new FileReader();
    reader.onload = () => {
      try {
        const text = reader.result;
        const data = JSON.parse(text);
        const imported = Array.isArray(data)
          ? data
          : Array.isArray(data.surveys)
          ? data.surveys
          : [];
        if (!imported.length) {
          alert("导入失败：文件中未找到有效的问卷数据。");
          return;
        }
        // 给所有导入的问卷和题目生成新的唯一 id，避免与现有数据冲突
        imported.forEach((survey) => {
          survey.id = createId("survey"); // 始终生成新ID，避免冲突
          if (!Array.isArray(survey.questions)) survey.questions = [];
          survey.questions.forEach((q) => {
            q.id = createId("q"); // 始终生成新ID，避免冲突
          });
        });
        surveys = surveys.concat(imported);
        persistSurveysImmediate();
        requestAnimationFrame(() => {
          alert(`成功导入 ${imported.length} 套问卷。`);
          // 导入后直接跳回基本信息填写界面开始作答
          setView("demographics");
        });
      } catch (e) {
        console.error("导入问卷失败", e);
        alert("导入失败：JSON 格式错误或内容不符合要求。");
      }
    };
    reader.readAsText(file, "utf-8");
  };
  input.click();
}

// 初始化防抖保存函数
initDebouncedPersist();

// 异步初始化数据
(async () => {
  try {
    surveys = await loadSurveys();
    responses = await loadResponses();
    
    // 如果 surveys 为空但 DEFAULT_SURVEYS 有数据，说明是首次加载，需要保存默认问卷到数据库
    if (surveys.length === 0 && DEFAULT_SURVEYS && DEFAULT_SURVEYS.length > 0) {
      surveys = JSON.parse(JSON.stringify(DEFAULT_SURVEYS));
      // 保存默认问卷到数据库，让其他用户可以直接使用
      try {
        await persistSurveysImmediate();
        console.log(`✓ 已自动加载 ${surveys.length} 份默认问卷到数据库，其他用户可直接使用`);
      } catch (e) {
        console.warn("保存默认问卷失败，但将继续使用内存中的默认问卷", e);
      }
    }
    
    // 自动检测并生成默认问卷代码（如果 DEFAULT_SURVEYS 为空，用于开发者获取代码）
    await autoGenerateDefaultSurveys();
    
    attachGlobalEvents();
    render();
  } catch (e) {
    console.error("初始化数据失败", e);
    // 即使失败也继续执行，尝试使用默认问卷
    if (DEFAULT_SURVEYS && DEFAULT_SURVEYS.length > 0) {
      surveys = JSON.parse(JSON.stringify(DEFAULT_SURVEYS));
    } else {
      surveys = [];
    }
    responses = [];
    attachGlobalEvents();
    render();
  }
})();
